import React from 'react'

// const getYears = () =>
//   Array.from(new Array(30), (_, index) => new Date().getFullYear() - index);

// const years = getYears();
const towns = ["Москва", "Тамбов", "Новосибирск", "Екатеринбург", "Казань",
"Нижний Новгород", "Челябинск", "Самара", "Омск", "Ростов-на-Дону", "Уфа",
"Красноярск", "Воронеж", "Пермь", "Волгоград", "Краснодар", "Саратов",
"Тюмень", "Тольятти", "Ижевск", "Барнаул", "Ульяновск", "Иркутск",
"Хабаровск", "Ярославль"];

function Select({onChangeFilters, release_year}) {
    return (
      <div className="form-group">
        <select
        id="release_year"
        className="form-control"
        name="release_year"
        value={release_year}
        onChange={onChangeFilters}
      >
        <option key={0} value="">
          Выберите год
        </option>
        {towns.map((town, index) => (
          <option key={index} value={town}>
            {town}
          </option>
        ))}
      </select>
    </div>
    )
}

export default Select;
